import React, { Fragment } from 'react'

class StorePicker extends React.Component {
  render() {
    return (
      <Fragment>
        <form className="store-selector">
          <h2>Please Enter a Store</h2>
          <input></input>
        </form>
      </Fragment>
    )
  }
}


export default StorePicker;
